DROP TABLE FACULTAD CASCADE CONSTRAINTS;
DROP TABLE CARRERA CASCADE CONSTRAINTS;
DROP TABLE ESTUDIANTE CASCADE CONSTRAINTS;
DROP TABLE ESPECIALIDAD CASCADE CONSTRAINTS;
DROP TABLE DOCENTE CASCADE CONSTRAINTS;
DROP TABLE ASIGNATURA CASCADE CONSTRAINTS;
DROP TABLE SEMESTRE CASCADE CONSTRAINTS;
DROP TABLE EVALUACION CASCADE CONSTRAINTS;
DROP TABLE RESULTADO_EVALUACION CASCADE CONSTRAINTS;
DROP TABLE INSCRIPCION CASCADE CONSTRAINTS;
DROP TABLE PERIODO CASCADE CONSTRAINTS;

DROP SEQUENCE seq_facultad; 
DROP SEQUENCE seq_carrera;
DROP SEQUENCE seq_estudiante;
DROP SEQUENCE seq_especialidad;
DROP SEQUENCE seq_docente;
DROP SEQUENCE seq_asignatura;
DROP SEQUENCE seq_semestre;
DROP SEQUENCE seq_evaluacion;
DROP SEQUENCE seq_resuleval;
DROP SEQUENCE seq_inscripcion;
DROP SEQUENCE seq_periodo;

CREATE TABLE FACULTAD
(
    id_facultad NUMBER PRIMARY KEY,
    nombre_facultad VARCHAR2(50) NOT NULL
);

CREATE TABLE CARRERA
(
    id_carrera NUMBER PRIMARY KEY,
    codigo_carrera VARCHAR2(50) NOT NULL UNIQUE,
    nombre_carrera VARCHAR2(50) NOT NULL,
    id_facultad NUMBER  NOT NULL
);

CREATE TABLE ESTUDIANTE
(
    id_estudiante NUMBER PRIMARY KEY,
    pnombre_estudiante VARCHAR2(50) NOT NULL,
    snombre_estudiante VARCHAR2(50),
    papellido_estudiante VARCHAR2(50) NOT NULL,
    sapellido_estudiante VARCHAR2(50),
    run_estudiante NUMBER NOT NULL UNIQUE,
    dv_estudiante VARCHAR2(1) NOT NULL,
    año_ingreso NUMBER(4) NOT NULL,
    id_carrera NUMBER NOT NULL
);

CREATE TABLE ESPECIALIDAD
(
    id_especialidad NUMBER PRIMARY KEY,
    nombre_especialidad VARCHAR2(50) NOT NULL,
    id_carrera NUMBER  NOT NULL
);

CREATE TABLE DOCENTE
(
    id_docente NUMBER PRIMARY KEY,
    pnombre_docente VARCHAR2(50) NOT NULL,
    snombre_docente VARCHAR2(50),
    papellido_docente VARCHAR2(50) NOT NULL,
    sapellido_docente VARCHAR2(50),
    run_docente NUMBER NOT NULL,
    dv_docente VARCHAR2(1) NOT NULL,
    id_especialidad NUMBER NOT NULL
);

CREATE TABLE ASIGNATURA
(
    id_asignatura NUMBER PRIMARY KEY,
    codigo_asignatura VARCHAR2(50) NOT NULL UNIQUE,
    nombre_asignatura VARCHAR2(50) NOT NULL,
    creditos NUMBER NOT NULL,
    nivel NUMBER NOT NULL,
    id_carrera NUMBER NOT NULL
);

CREATE TABLE SEMESTRE
(
    id_semestre NUMBER PRIMARY KEY,
    año NUMBER(4) NOT NULL,
    id_periodo NUMBER NOT NULL,
    fecha_ini DATE,
    fecha_ter DATE
);

CREATE TABLE EVALUACION
(
    id_evaluacion NUMBER PRIMARY KEY,
    id_asignatura NUMBER NOT NULL,
    codigo_evaluacion VARCHAR2(50) NOT NULL,
    tipo_evaluacion VARCHAR2(50) NOT NULL,
    fecha_evaluacion DATE NOT NULL,
    ponderacion NUMBER NOT NULL
);

CREATE TABLE RESULTADO_EVALUACION
(
    id_resul_eval NUMBER PRIMARY KEY,
    id_estudiante NUMBER NOT NULL,
    id_evaluacion NUMBER NOT NULL,
    nota_resul_eval NUMBER(2, 1) NOT NULL
);

CREATE TABLE INSCRIPCION
(
    id_inscripcion NUMBER PRIMARY KEY,
    id_estudiante NUMBER NOT NULL,
    id_asignatura NUMBER NOT NULL,
    id_docente NUMBER NOT NULL,
    id_semestre NUMBER NOT NULL,
    nota_final NUMBER(2, 1)
);

CREATE TABLE PERIODO
(
	id_periodo NUMBER,
	nombre_periodo VARCHAR2(50)
);

	-- CARRERAS
		ALTER TABLE CARRERA
		ADD CONSTRAINT fk_carrera_facultad
		FOREIGN KEY (id_facultad)
		REFERENCES FACULTAD (id_facultad);

	-- ESPECIALIDAD
		ALTER TABLE ESPECIALIDAD
		ADD CONSTRAINT fk_especialidad_carrera
		FOREIGN KEY (id_carrera)
		REFERENCES CARRERA (id_carrera);

	-- ESTUDIANTE
		ALTER TABLE ESTUDIANTE
		ADD CONSTRAINT fk_estudiantes_carrera
		FOREIGN KEY (id_carrera)
		REFERENCES CARRERA (id_carrera);

	-- DOCENTE
		ALTER TABLE DOCENTE
		ADD CONSTRAINT fk_docentes_especialidad
		FOREIGN KEY (id_especialidad)
		REFERENCES ESPECIALIDAD (id_especialidad);

	-- ASIGNATURAS
		ALTER TABLE ASIGNATURA
		ADD CONSTRAINT fk_asignatura_carrera
		FOREIGN KEY (id_carrera)
		REFERENCES CARRERA (id_carrera);
		
	-- SEMESTRE
		ALTER TABLE SEMESTRE
		ADD CONSTRAINT fk_semestre_periodo
		FOREIGN KEY (id_periodo)
		REFERENCES PERIODO (id_periodo);

	-- EVALUACION
		ALTER TABLE EVALUACION
		ADD CONSTRAINT pk_evaluaciones_asignatura
		FOREIGN KEY (id_asignatura)
		REFERENCES ASIGNATURA (id_asignatura);

	-- RESULTADO_EVALUACION
		ALTER TABLE RESULTADO_EVALUACION
		ADD CONSTRAINT pk_resuleval_estudiantes
		FOREIGN KEY (id_estudiante)
		REFERENCES ESTUDIANTE (id_estudiante);
		
		ALTER TABLE RESULTADO_EVALUACION
		ADD CONSTRAINT pk_resuleval_evaluacion
		FOREIGN KEY (id_evaluacion)
		REFERENCES EVALUACION (id_evaluacion);

	-- INSCRIPCION
		ALTER TABLE INSCRIPCION
		ADD CONSTRAINT pk_inscripciones_estudiante
		FOREIGN KEY (id_estudiante)
		REFERENCES ESTUDIANTE (id_estudiante);
		
		ALTER TABLE INSCRIPCION
		ADD CONSTRAINT pk_inscripciones_asignatura
		FOREIGN KEY (id_asignatura)
		REFERENCES ASIGNATURA (id_asignatura);
		
		ALTER TABLE INSCRIPCION
		ADD CONSTRAINT pk_inscripciones_docente
		FOREIGN KEY (id_docente)
		REFERENCES DOCENTE (id_docente);
		
		ALTER TABLE INSCRIPCION
		ADD CONSTRAINT pk_inscripciones_semestre
		FOREIGN KEY (id_semestre)
		REFERENCES SEMESTRE (id_semestre);
        
-- SECUENCIA PARA DATOS
